import React from "react";
import likeBtn from "../../images/like_btn.svg";
import commentBtn from "../../images/comment_btn.svg";

const FreeBoardLists = ({ posts, loading }) => {
  //console.log(posts);

  return (
    <>
      {loading && <div> loading... </div>}
      <div className="max-w-480 ">
        {posts.map((post) => (
          <div className="h-30 p-5 border-b" key={post.id}>
            <h2 className="text-base truncate mb-1">{post.title}</h2>
            <p className="text-sm text-gray-400 line-clamp-2 mb-1">
              {post.body}
            </p>
            <div className="flex justify-between text-xs">
              <div className="">
                <span className="text-gray-400 mr-1">00/00/00</span>
                <span>{`유저 ${post.userId}`}</span>
              </div>
              <div className="flex">
                {/* 좋아요 개수 */}
                <img className="pl-1" src={likeBtn} alt="like-button" />
                <span className="pl-3">{Math.floor(Math.random() * 11)}</span>
                {/* 댓글 개수 */}
                <img className="pl-1" src={commentBtn} alt="comment-button" />
                <span>{Math.floor(Math.random() * 11)}</span>
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default FreeBoardLists;
